import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import {
  Cog6ToothIcon,
  BellIcon,
  HandRaisedIcon,
  FaceSmileIcon,
  BookmarkIcon,
  UsersIcon,
} from '@heroicons/react/24/solid';

const Dashboard = () => {
  const navigate = useNavigate();
  const [active, setActive] = useState(null);

  const navItems = [
    { id: 'desafios', label: 'desafios', icon: HandRaisedIcon, to: '/challenges' },
    { id: 'feed', label: 'feed', icon: FaceSmileIcon, to: '/feed' },
    { id: 'home', label: 'newsletter', icon: BookmarkIcon, to: '/newsletter' },
    { id: 'comunidade', label: 'comunidade', icon: UsersIcon, to: '/community' },
  ];

  return (
    <div className="min-h-screen bg-white flex flex-col items-center px-6 pt-8">
      <div className="w-full flex justify-end">
        <button className="p-2">
          <Cog6ToothIcon className="h-6 w-6 text-gray-700" />
        </button>
      </div>

      <div className="relative mt-2">
        <div className="h-32 w-32 rounded-full bg-gray-200 overflow-hidden flex items-center justify-center">
          <img
            src="/imgs/av1.png"
            alt="avatar"
            onError={(e) => { e.currentTarget.src = 'https://via.placeholder.com/128'; }}
            className="h-full w-full object-cover"
          />
        </div>
        <button
          className="absolute -top-1 -right-1 h-10 w-10 rounded-full bg-brand-red flex items-center justify-center shadow-md"
          aria-label="Notificações"
          onClick={() => setActive('notifs')}
        >
          <BellIcon className="h-5 w-5 text-white" />
        </button>
      </div>

      <h2 className="text-3xl font-bold text-gray-800 mt-4">Carlos Silva</h2>
      <p className="text-sm text-gray-600 -mt-1">carlos.silva@pucpr.edu.br</p>

      <div className="mt-3 inline-flex flex-col items-center">
        <span className="px-4 py-1 rounded-full border border-gray-400 text-sm text-gray-700 bg-white">
          Designer Disruptivo
        </span>
        <span className="text-[11px] text-gray-500 mt-1">
          10 desafios com feedback alto!
        </span>
      </div>

      <div className="w-full mt-8 space-y-6">
        <button className="w-full bg-brand-red rounded-3xl px-6 py-6 text-left text-white shadow-lg">
          <span className="block text-2xl font-bold">Meus Favoritos</span>
          <span className="mt-3 inline-block text-xs font-semibold px-3 py-1 rounded-full bg-white/20 backdrop-blur">
            53 favoritados
          </span>
        </button>
        <button className="w-full bg-brand-orange rounded-3xl px-6 py-6 text-left text-white shadow-lg">
          <span className="block text-2xl font-bold">Meus Desafios</span>
          <span className="mt-3 inline-block text-xs font-semibold px-3 py-1 rounded-full bg-white/20 backdrop-blur">
            10 desafios completos
          </span>
        </button>
        <button className="w-full bg-brand-yellow rounded-3xl px-6 py-6 text-left text-white shadow-lg">
          <span className="block text-2xl font-bold">Meus Feedbacks</span>
          <span className="mt-3 inline-block text-xs font-semibold px-3 py-1 rounded-full bg-white/20 backdrop-blur">
            10 desafios completos
          </span>
        </button>
      </div>

      <div className="mt-10 w-full">
        <div className="mx-auto max-w-sm bg-white rounded-full shadow-[0_4px_16px_rgba(0,0,0,0.15)] flex justify-between px-8 py-5">
          {navItems.map((n) => {
            const Icon = n.icon;
            const activeState = active === n.id;
            return (
              <button
                key={n.id}
                onClick={() => { setActive(n.id); navigate(n.to); }}
                className="flex flex-col items-center gap-1 group"
              >
                <Icon
                  className={`h-6 w-6 ${
                    activeState ? 'text-brand-red scale-110' : 'text-gray-700'
                  } transition`}
                />
                <span
                  className={`text-[11px] font-medium ${
                    activeState ? 'text-brand-red' : 'text-gray-600'
                  }`}
                >
                  {n.label}
                </span>
              </button>
            );
          })}
        </div>

        <div className="mt-6 flex flex-col items-center">
          <p className="text-[11px] text-gray-500 mb-2">conectar ao</p>
          <button className="bg-[#0077b5] text-white font-bold px-5 py-2 rounded-full text-sm shadow">
            LinkedIn
          </button>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
